// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;
pragma abicoder v2;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/token/ERC1155/utils/ERC1155Holder.sol";
import "@openzeppelin/contracts/utils/Counters.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "./NextItem.sol";

contract NextAuction is Ownable, ERC1155Holder {
    using Counters for Counters.Counter;

    address nextverseWallet;
    address itemContract;
    NextItem public NFTs;

    struct Auction {
        bool isClaimed;
        address nftContract;
        address erc20Contract;
        address highestBidder;
        uint256 id;
        uint256 tokenId;
        uint256 initialPrice;
        uint256 tickSize;
        uint256 highestPrice;
        uint256 startTime;
        uint256 endTime;
    }

    Counters.Counter private _auctionIds;
    mapping(uint256 => Auction) private auctions;
    mapping(uint256 => mapping(address => uint256)) private biddingPrices;

    uint256 extendTime = 15 * (1 minutes);

    event AuctionAdded(address indexed sender, Auction auction);

    event InitialPriceUpdated(
        address indexed sender,
        uint256 id,
        uint256 initialPrice,
        address erc20Contract
    );

    event HighestPriceUpdated(
        address indexed sender,
        uint256 id,
        uint256 highestPrice,
        uint256 endTime
    );

    event AuctionTimeUpdated(
        address indexed sender,
        uint256 id,
        uint256 startTime,
        uint256 endTime
    );

    event Withdraw(address indexed sender, uint256 id, uint256 amount);

    event EndAuction(address indexed sender, uint256 id);

    event ItemClaimed(address indexed sender, uint256 id);

    constructor(address ownerWallet) {
        nextverseWallet = ownerWallet;
    }

    modifier isValidAuctionId(uint256 id) {
        require(id < _auctionIds.current(), "Invalid itemId");
        _;
    }

    modifier isValidTokenId(uint256 tokenId, address nftContract) {
        INFTFactory nftFactory = INFTFactory(nftContract);
        require(tokenId < nftFactory.getUniqueTokenNum(), "Invalid tokenId");
        _;
    }

    function setExtendTime(uint256 duration) public onlyOwner {
        extendTime = duration * (1 minutes);
    }

    function addAuction(Auction memory auction)
        public
        onlyOwner
        isValidTokenId(auction.tokenId, auction.nftContract)
    {
        require(auction.initialPrice > 0, "Price must be greater than 0");
        IERC1155 nftFactory = IERC1155(auction.nftContract);
        nftFactory.safeTransferFrom(owner(), address(this), auction.tokenId, 1, "0x0");

        uint256 id = _auctionIds.current();
        _auctionIds.increment();

        auction.id = id;
        auction.isClaimed = false;
        auction.highestPrice = auction.initialPrice;
        auction.highestBidder = owner();

        auctions[id] = auction;

        emit AuctionAdded(msg.sender, auction);
    }

    function updateAuctionTime(uint256 auctionId, uint256 startTime, uint256 endTime)
        public 
        onlyOwner 
        isValidAuctionId(auctionId)
    {
        Auction storage auction = auctions[auctionId];
        require(auction.startTime > block.timestamp, "Only allow for upcoming auction");
        auction.startTime = startTime;
        auction.endTime = endTime;

        emit AuctionTimeUpdated(msg.sender, auctionId, startTime, endTime);
    }

    function updateInitialPrice(uint256 auctionId, uint256 price, address erc20Contract)
        public 
        onlyOwner 
        isValidAuctionId(auctionId)
    {
        Auction storage auction = auctions[auctionId];
        require(auction.startTime > block.timestamp, "Only allow for upcoming auction");

        auction.initialPrice = price;
        auction.erc20Contract = erc20Contract;

        emit InitialPriceUpdated(msg.sender, auctionId, price, erc20Contract);
    }

    function bid(uint256 auctionId, uint256 price)
        public
        isValidAuctionId(auctionId)
    {
        Auction storage auction = auctions[auctionId];
        uint256 currentTime = block.timestamp;
        require(((auction.startTime <= currentTime) && (currentTime < auction.endTime)), "Auction is not available");
        require(auction.highestBidder != msg.sender, "You are the highest bidder");

        require(price >= (auction.highestPrice + auction.tickSize), "Price must be greater than highestPrice + tickSize");

        IERC20 token = IERC20(auction.erc20Contract);

        uint256 amount = price - biddingPrices[auctionId][msg.sender];
        biddingPrices[auctionId][msg.sender] = price;
        token.transferFrom(msg.sender, address(this), amount);

        auction.highestPrice = price;
        auction.highestBidder = msg.sender;

        uint256 newEndTime = currentTime + extendTime;
        if (newEndTime > auction.endTime) {
            auction.endTime = newEndTime;
        }

        emit HighestPriceUpdated(msg.sender, auctionId, price, auction.endTime);
    }

    function withdraw(uint256 auctionId)
        public
        isValidAuctionId(auctionId)
    {
        require(biddingPrices[auctionId][msg.sender] > 0, "no money to withdraw");
        require(auctions[auctionId].highestBidder != msg.sender, "Highest bidder can not withdraw");

        IERC20 token = IERC20(auctions[auctionId].erc20Contract);
        uint256 amount = biddingPrices[auctionId][msg.sender];
        biddingPrices[auctionId][msg.sender] = 0;
        token.transfer(msg.sender, amount);

        emit Withdraw(msg.sender, auctionId, amount);
    }

    function claimItem(uint256 auctionId)
        public
        isValidAuctionId(auctionId)
    {
        Auction storage auction = auctions[auctionId];
        require(msg.sender == auction.highestBidder, "caller must be the highest bidder");

        uint256 currentTime = block.timestamp;
        require(currentTime >= auction.endTime, "not ended yet");
        require(auction.isClaimed == false, "Claimed item");
        auction.isClaimed = true;

        if (owner() != auction.highestBidder) {
            IERC20 token = IERC20(auction.erc20Contract);
            token.transfer(nextverseWallet, auction.highestPrice);
        }

        IERC1155 nft = IERC1155(auction.nftContract);
        nft.safeTransferFrom(
            address(this), 
            auction.highestBidder, 
            auction.tokenId, 
            1, 
            "0x0"
        );

        emit ItemClaimed(msg.sender, auctionId);
    }

    function getAuction(uint256 auctionId)
        public
        view
        isValidAuctionId(auctionId)
        returns (Auction memory)
    {
        return auctions[auctionId];
    }

    function getOnBiddingItems()
        public
        view
        returns (Auction[] memory)
    {
        uint256 maxIndex = _auctionIds.current();
        uint256 currentTime = block.timestamp;

        uint256 cnt = 0;
        for (uint256 i = 0; i < maxIndex; i++) {
            if ((auctions[i].startTime <= currentTime) && (currentTime  < auctions[i].endTime)) {
                cnt++;
            }
        }

        Auction[] memory ret = new Auction[](cnt);
        for (uint256 i = 0; i < maxIndex; i++) {
            if ((auctions[i].startTime <= currentTime) && (currentTime  < auctions[i].endTime)) {
                cnt--;
                ret[cnt] = auctions[i];
            }
        }

        return ret;
    }

    function getUpcomingAuctions()
        public
        view
        returns (Auction[] memory)
    {
        uint256 maxIndex = _auctionIds.current();
        uint256 currentTime = block.timestamp;

        uint256 cnt = 0;
        for (uint256 i = 0; i < maxIndex; i++) {
            if (currentTime < auctions[i].startTime) {
                cnt++;
            }
        }

        Auction[] memory ret = new Auction[](cnt);
        for (uint256 i = 0; i < maxIndex; i++) {
            if (currentTime < auctions[i].startTime) {
                cnt--;
                ret[cnt] = auctions[i];
            }
        }

        return ret;
    }

    function getBiddingPrice(uint256 auctionId, address bidder)
        public
        isValidAuctionId(auctionId)
        view
        returns (uint256 amount)
    {
        return biddingPrices[auctionId][bidder];
    }

    function getTotalAuctions()
        public
        view
        returns (uint256)
    {
        return _auctionIds.current();
    }
}
